"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Prenatal care (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H878802929\">",
"      <span class=\"h1\">",
"       What is prenatal care?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Prenatal care describes the medical care women get during their pregnancy. As part of your prenatal care, the doctor or midwife will:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Figure out when your baby is due",
"       </li>",
"       <li>",
"        Monitor your health to watch for problems",
"       </li>",
"       <li>",
"        Monitor your baby&rsquo;s health to check that he or she is growing well",
"       </li>",
"       <li>",
"        Talk with you about pregnancy, labor, and delivery, and make a plan for your labor and delivery",
"       </li>",
"       <li>",
"        Do tests to check you and your baby for different health conditions",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H878802944\">",
"      <span class=\"h1\">",
"       What happens at my first prenatal visit?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or midwife will ask about your health and medical history, and figure out when your baby is due.",
"     </p>",
"     <p>",
"      He or she will also do an exam, including a speculum exam. For this, the doctor or midwife will place a metal or plastic device (called a speculum) in your vagina (",
"      <a class=\"graphic graphic_figure graphicRef82935 \" href=\"mobipreview.htm?7/20/7495\">",
"       figure 1",
"      </a>",
"      ). The speculum holds the walls of the vagina open. That way, the doctor or midwife can see the cervix. He or she will also put 1 hand on your belly and insert 1 or 2 gloved fingers of the other hand into the vagina. This is so your doctor or midwife can check your ovaries and the size of your uterus.",
"     </p>",
"     <p>",
"      He or she will also do tests that can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A urine test",
"       </li>",
"       <li>",
"        Blood tests &ndash; Some blood tests check your general health. Other blood tests check for specific conditions that could cause problems for you or your baby.",
"       </li>",
"       <li>",
"        Lab tests on a sample of cells from the cervix &ndash; The doctor will use a cotton swab to take some cells from the cervix. He or she will test the sample for infections or cancer of the cervix.",
"       </li>",
"       <li>",
"        An ultrasound &ndash; An ultrasound uses sound waves to create pictures of the inside of your body and of your baby. This test is done to check your due date and see if you are pregnant with more than 1 baby.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H878802976\">",
"      <span class=\"h1\">",
"       What will happen at each prenatal visit?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In the United States, at all prenatal visits (including the first visit), the doctor or midwife will:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Ask about your symptoms and answer any questions you have",
"       </li>",
"       <li>",
"        Check your blood pressure &ndash; Having high blood pressure can lead to problems, including a serious condition called &ldquo;preeclampsia.&rdquo;",
"       </li>",
"       <li>",
"        Check your weight &ndash; The amount of weight you should gain during pregnancy depends partly on what your weight was before you got pregnant.",
"       </li>",
"       <li>",
"        Measure the size of your uterus &ndash; Your uterus will get bigger as your pregnancy progresses.",
"       </li>",
"       <li>",
"        Listen for your baby&rsquo;s heartbeat &ndash; The doctor or midwife will be able to hear your baby&rsquo;s heartbeat starting at about 12 weeks of pregnancy.",
"       </li>",
"       <li>",
"        Test your urine to check for sugar or protein &ndash; Having sugar or protein in your urine might be a sign of a more serious problem.",
"       </li>",
"       <li>",
"        Ask about your baby&rsquo;s movements &ndash; Women start feeling their baby move at different times. Most women feel their baby move by 25 weeks of pregnancy.",
"       </li>",
"       <li>",
"        Check your baby&rsquo;s position in your uterus &ndash; In the last 3 months of pregnancy, the doctor or midwife will check your baby&rsquo;s position at each visit. He or she will check whether your baby&rsquo;s head or buttocks are down and closest to your vagina (",
"        <a class=\"graphic graphic_figure graphicRef72643 \" href=\"mobipreview.htm?17/45/18131\">",
"         figure 2",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H878803014\">",
"      <span class=\"h1\">",
"       What other tests are part of prenatal care?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or midwife will order other tests during your pregnancy. These include routine tests that all pregnant women will have. They also include tests that some women choose to have.",
"     </p>",
"     <p>",
"      Tests done during pregnancy can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A test to check for diabetes (high blood sugar) &ndash; This involves drinking a sugar drink and then having your blood drawn.",
"       </li>",
"       <li>",
"        Blood tests to check for certain conditions or infections &ndash; These include tests to check your blood type and see if you have a condition called anemia. They also include tests to check for infections that you could pass to your baby or that could harm your baby. Some of these infections are rubella, hepatitis B, and syphilis.",
"       </li>",
"       <li>",
"        An ultrasound &ndash; This test checks your placenta, the fluid around your baby, how your baby is growing, and how your baby&rsquo;s organs are developing.",
"       </li>",
"       <li>",
"        Tests to check for birth defects or problems babies can be born with &ndash; For example, women can choose to test their baby for Down syndrome. Down syndrome is a life-long condition that causes medical and learning problems.",
"       </li>",
"       <li>",
"        Tests on your vaginal discharge (the fluid that leaks from your vagina) to check for an infection",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H878803029\">",
"      <span class=\"h1\">",
"       How often will I see my doctor or midwife during pregnancy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your visits to your doctor or midwife will get more frequent as your pregnancy progresses. One common schedule of visits is the following:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Every 4 weeks until you are about 28 weeks pregnant",
"       </li>",
"       <li>",
"        Then every 2 to 3 weeks until you are about 36 weeks pregnant",
"       </li>",
"       <li>",
"        Then every week until delivery",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Women with certain medical conditions (including conditions they had before they got pregnant) might need to see their doctor or midwife more often. They might also need other tests to follow their medical condition during pregnancy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H878803044\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
