var title_f36_29_37340="ARV prophylaxis for women not needing treatment";
var content_f36_29_37340=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F51372&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F51372&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antiretroviral prophylaxis options recommended for infants of HIV-infected women who do not need treatment for their own health",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Maternal AZT + infant ARV prophylaxis",
"        <br/>",
"        (Option A)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Maternal triple ARV prophylaxis",
"        <br/>",
"        (Option B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Mother",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Mother",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"5\">",
"        <p>",
"         Antepartum twice-daily AZT starting from as early as 14 weeks of gestation and continued during pregnancy. At onset of labor, sd-NVP and initiation of twice daily AZT + 3TC for&nbsp;seven days postpartum.",
"        </p>",
"        <p>",
"         (Note: If maternal AZT was provided for more than&nbsp;four weeks antenatally, omission of the sd-NVP and AZT + 3TC tail can be considered; in this case, continue maternal AZT during labor and stop at delivery).",
"        </p>",
"       </td>",
"       <td class=\"sublist2_start\">",
"        Triple ARV prophylaxis starting from as early as 14 weeks of gestation and continued until delivery, or, if breastfeeding, continued until&nbsp;one week after all infant exposure to breast milk has ended.*&bull; Recommended regimens include:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        AZT + 3TC + LPV/r or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        AZT + 3TC + ABC or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        AZT + 3TC + EFV or",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        TDF + 3TC (or FTC) + EFV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Infant",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Infant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         For breastfeeding infants:",
"        </em>",
"        <br/>",
"        Daily NVP from birth for a minimum of&nbsp;four to&nbsp;six weeks, and until&nbsp;one week after all exposure to breast milk has ended.*",
"       </td>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        <em>",
"         Irrespective of mode of infant feeding:",
"        </em>",
"        <br/>",
"        Daily NVP or twice-daily AZT from birth until&nbsp;four to&nbsp;six weeks of age.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Infants receiving replacement feeding only:",
"        </em>",
"        <br/>",
"        Daily NVP or sd-NVP + twice-daily AZT from birth until&nbsp;four to&nbsp;six weeks of age.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    AZT: zidovudine; 3TC: lamivudine; NVP: nevirapine; sd-NVP: single dose nevirapine; LPV/r: lopinavir/ritonavir; ABC: abacavir; EFV: efavirenz; TDF: tenofovir; FTC: emtricitabine.",
"    <div class=\"footnotes\">",
"     <p>",
"      * Exclusive breastfeeding is recommended for the first six months followed by breastfeeding&nbsp;with appropriate complementary feeding for another six months.",
"      <br>",
"       &bull; In countries that have the programmatic capacity, lifelong continuation of a maternal Option B antiretroviral regimen is another option.",
"       <br/>",
"      </br>",
"     </p>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: World Health Organization. Antiretroviral drugs for treating pregnant women and preventing HIV infection in infants: towards universal access: Recommendations for a public health approach (2010 version). World Health Organization, Geneva 2010. Copyright &copy; 2010 WHO. Available at:",
"     <a href=\"file://whqlibdoc.who.int/publications/2010/9789241599818_eng.pdf\">",
"      file://whqlibdoc.who.int/publications/2010/9789241599818_eng.pdf",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
